                if( newIndex > rts.length-1 ){
                    newIndex = 0;
                }
                this.rt = rts[newIndex];
                this.index = newIndex;
            }
        },
        mounted(){
            window.addEventListener('toggleScheme', this.toggle);
        }
	}

</script>
